    # In the range of A_1, A_2,..., A_n, we always have two differences between A[i-1] and A[i].
    # Each difference must be positive and all the elements must be in the range of the range of A[i-1], A[i], A[i+1],..., A[n-1].
    # In other words, we have n - 1 differences.
    # In A[i], the differences between A[i-1] and A[i], A[i+1] and..., A[n-1] must be positive.
    # In other words, the first difference between A[i] and A[i+1] must be positive.
    # Thus, we want to find the maximum absolute difference of two elements.

    # Input will come in the form of an integer array A[i] = A[i-1], A[i], A[i+1],..., A[n-1]
    # A[i] is a value in the range of A[i-1], A[i], A[i+1],..., A[n-1].

    # We want to find the maximum absolute difference of two elements.
    # If A[i] = A[i-1] + A[i+1], we can always find it by choosing A[i] = A[i-1] + A[i+1].
    # But it may not always be possible.
    # A[i] = A[i-1] + A[i+1] = A[i-1] + A[i+1] + A[i-1] = A[i-1] + A[i-1] + A[i+1] + A[i+1] = A[i-1] + A[i-1] + A[i+1] + A[i+1] = A[i-1] + A[i-1] + A[i+1] + A[i+1] + A[i+1] = A[i-1] + A[i-1] + A[i+1] + A[i+1] = A[i-1] + A[i-1] + A[i+1] + A[i+1]
    # Thus, we can find the maximum absolute difference of two elements.

    def maxAbsDifference(A: List[int], i: int, j: int):
        if i == 0:
            return A[j]
        if A[i-1] + A[i] == A[i-1] + A[i]:
            return maxAbsDifference(A, i-1, j)
        if A[i-1] + A[i+1] == A[i-1] + A[i+1]:
