        if A[i-1] + A[i] == A[i-1] + A[i+1]:
            return maxAbsDifference(A, i-1, i+1)
        return max(A[j], A[i-1], A[i+1], A[i+1], A[j])

    return maxAbsDifference(A, n-1, 0)

