            self.cur_node.next = self.cur_node
            self.cur_node = self.cur_node.next
            self.nodes_to_process.append(self.cur_node)

    def process_until_node(self, node):
        while node!= self.cur_node:
            node = node.next
        return node

    def start_at_node(self, index):
        node = self.cur_node
        for i in range(index):
            node = node.next
        return node

    def length_of_list(self, list):
        total = 0
        for i in list:
            total += i
        return total

    def get_dist_for_each_node(self, node):
        dist = 0
        while node!= self.cur_node:
            node = node.next
            dist += 1
        return dist

    def find_k_min(self, start, end, k):
        if k <= 0:
            return 0

        if end == start:
            return 0

        cur_dist = self.get_dist_for_each_node(start)
        cur_dist += self.get_dist_for_each_node(end)
        k -= 1

        while k > 0:
            mid = (start + end) // 2
            cur_dist_for_mid = self.get_dist_for_each_node(mid)
            if cur_dist_for_mid == k:
                return mid
            elif cur_dist_for_mid < k:
                end = mid
                cur_dist = cur_dist_for_mid
                k -= 1
            else:
                start = mid
                cur_dist = cur_dist_for_mid
                k -= 1
        return start

    def k_min(self, list, n, k):
        if n == 1:
            return list[0]
        start = self.find_k_min(0, n-1, k)
        end = self.find_k_min(start, n-1, k)
        return self.k_min(list, n-1, k) + list[start]

    def get_dist(self, start, end):
        return self.length_of_list(self.k_min(self.nodes_to_process, end - start + 1, start))

    def solution(self, K, N, A):
