        n = len(A)
        for i in range(K):
            dist.append(self.get_dist(0, n - 1))
            n -= 1
        for i in range(K, N):
            dist.append(self.get_dist(i, n - 1))
            n -= 1
        dist.sort()
        return dist[-1]

